// HOME BUTTON
import React from "react";
import styled from "styled-components";

const Power = styled.button`
  position: fixed;
  top: 2rem;
  left: 50%;
  transform: translate(-50%, 0);

  background-color: #fcf6f4;
`;

const PowerButton = () => {
  return <Power>Home</Power>;
};

export default PowerButton;
